import React from 'react';
import './Sidebar.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faPieChart, faCog, faFolder, faUsers, faSpinner, faBuilding } from '@fortawesome/free-solid-svg-icons';

const Sidebar = () => {
  return (
    <div className="sidebar">
      <div className="sidebar-header">
        <img src="profile.jpg" alt="Profile Picture" />
        <span>Bruce Wayne</span>
      </div>
      <ul>
        <li><FontAwesomeIcon icon={faPieChart} /> Overview</li>
        <li><FontAwesomeIcon icon={faBuilding} /> Organization</li>
        <li><FontAwesomeIcon icon={faFolder} /> Projects</li>
        <li><FontAwesomeIcon icon={faUsers} /> People</li>
        <li><span>Pages</span></li>
        <ul className="nested-list">
          <li><FontAwesomeIcon icon={faSpinner} /> Example</li>
          <li><FontAwesomeIcon icon={faCog} /> Settings</li>
          <li><FontAwesomeIcon icon={faSpinner} /> Example</li>
          <li><FontAwesomeIcon icon={faSpinner} /> Example</li>
        </ul>
      </ul>
    </div>
  );
};

export default Sidebar;
